function PositionRightLegend(chartId, chartWidth){
    var legendDiv = document.querySelector(chartId + ' svg g .c3-legend-item');
    var legendDivParent = legendDiv.parentNode.getAttribute('transform');
    var parts  = SplitTransformValue(legendDivParent);	
    var firstX = parts[0];
    legendDiv.parentNode.setAttribute('transform', 'translate('+(parseInt(firstX)+55)+',0)')
    document.querySelector(chartId+' svg').setAttribute('width', (chartWidth+50));
}
function SplitTransformValue(transformVal){
	var translate='translate(';
	var firstIndex=transformVal.indexOf(translate);
	var secondIndex=transformVal.indexOf(')');
	var splitInTwo;
	if(firstIndex > -1){
		splitInTwo=transformVal.substring(firstIndex+translate.length,secondIndex)
		var parts = splitInTwo.split(',');
		return parts;
	}
	return null;
}
